INSERT INTO `tx_seminars_sites` VALUES
(1,15,1628001887,1628001690,1,0,0,'DJH Jugendherberge Bonn','Haager Weg 42\r\n53127 Bonn','53127','Bonn','DE','https://www.jugendherberge.de/jugendherbergen/bonn-438/portraet/','<h1>So erreichen Sie die Jugendherberge Bonn mit öffentlichen Verkehrsmitteln</h1>\r\n<h2>Ab Flughafen Köln/Bonn</h2>\r\n<p>Mit dem Airportbus (Linie SB60) erreichen Sie in 30 min. den Bonner Hauptbahnhof.</p>\r\n<h2>Ab Bonn Hbf</h2>\r\n<p>Direkt gegenüber vom Hauptbahnhof befindet sich der zentrale Busbahnhof. Vom Bussteig A1 nehmen Sie die Buslinie 600 Richtung Ippendorf-Altenheim bis zur Haltestelle \"Jugendherberge\".</p>\r\n<h1>So erreichen Sie die Jugendherberge Bonn mit dem Bus oder Pkw</h1>\r\n<h2>Aus dem Norden, Süden und Osten kommend</h2>\r\n<p>A3 bis Autobahnkreuz Bonn‐Siegburg, dann auf die A 560 bis Autobahndreieck Sankt Augustin, weiter auf der A 565 Richtung Bonn / Koblenz bis Ausfahrt Bonn-Hardtberg/Röttgen.</p>\r\n<h2>Aus Köln kommend</h2>\r\n<p>Am Kölner Ring auf die A 555 bis Autobahnkreuz Bonn-Nord, dort auf die A 565 Richtung Bonn / Koblenz wechseln, weiter bis Ausfahrt Bonn-Hardtberg/Röttgen.</p>\r\n<h2>Aus dem Westen kommend</h2>\r\n<p>A 61 bis Autobahnkreuz Meckenheim, dort auf die A 565 Richtung Bonn wechseln, weiter bis Ausfahrt Bonn-Hardtberg/Röttgen.</p>\r\n<h2>Ab Ausfahrt Bonn-Hardtberg/Röttgen</h2>\r\n<p>Nach der Ausfahrt Bonn‐Hardtberg/Röttgen links abbiegen und bergab bis zur Verkehrsampel fahren, dort rechts abbiegen (Provinzialstraße), dem Straßenverlauf folgen (Reichsstraße) Richtung Venusberg/Uni-Klinik bis vor den Stadtteil Röttgen. Dort links in die Röttgener Straße abbiegen (Achtung: scharfe S-Kurve, Tempo 30). Dem Straßenverlauf folgen bis zur zweiten Straßeneinmündung auf der rechten Seite, dort rechts abbiegen und im spitzen Winkel sofort wieder rechts in den Gudenauer Weg abbiegen (Tempo 30 beachten!). Der Straße folgen bis zur Spreestraße, an der Kreuzung nach links versetzt in die Spreestraße einbiegen, am Ende der Spreestraße nach links in den Haager Web abbiegen. Nach ca. 800 m erreichen Sie die Jugendherberge.</p>\r\n<h1>Anreise mit dem Fahrrad</h1>\r\n<p>Zur Aufbewahrung Ihrer Fahrräder steht Ihnen im Haus ein gesicherter Abstellplatz zur Verfügung.</p>',''),
